import React from 'react';
import Header from '../../components/header/Header';
import Footer from '../../components/footer/Footer';
import './contact.css';

const Contact = () => {
    return (
        <>
            <section className='contact'>
                <Header />
                <div className='contact__container'>
                </div>
                <Footer />
            </section>
        </>
    )
}

export default Contact
